// Popupapi.js
import axios from 'axios';

export const updateImageStatus = async (id, status) => {
  try {
    const response = await axios.put(`https://portal-test.yenaengineering.nl/api/images/${id}`, {
      status: status
    });
    return response.data;
  } catch (error) {
    console.error(error);
  }
}
